(68, 17, 'Wanda', 'French Bulldog', 'Wanda is a little over one year old. She loves eating snacks, meeting new people and giving them kisses, She also loves to snuggle in and watch movies with her mom. ', 'uploads/1652935774.3176_wanda.jpeg', '2022-05-18 23:51:55'),
(69, 17, 'Gemma', 'Golden Doodle', 'Gemma will be two years old in October! She enjoys long walks and loves to play! Her best friend is named Wanda, who is a french bulldog.', 'uploads/1652985753.0281_gemma.jpeg', '2022-05-19 13:46:57'),
(70, 17, 'Buddy', 'Golden Retriever', 'Buddy is a five year old Golden Retriever that my friend, Jim, owns. Buddy likes to do many things: snack, morning walks, but his favorite thing to do is to sit by the living room window and bark at the squirrel that sits there every morning.', 'uploads/1653010222.2019_buddy.jpeg', '2022-05-19 20:33:23'),
(71, 17, 'Riggs', 'French Mastiff', 'Riggs is a French Mastiff. He is Wanda\'s classmate at dog training.', 'uploads/1653011370.2261_riggs.jpeg', '2022-05-19 20:49:57'),
(72, 17, 'Ziggy', 'Dalmatian', 'Ziggy is a 3 year old Dalmatian that I met while I was walking Wanda and Gemma. He wasn\'t particularly friendly. He barked and snarled a lot.', 'uploads/1653012433.0267_ziggy.jpeg', '2022-05-19 21:09:24'),
(73, 17, 'Fei Fei', 'Chow Chow', 'Fei Fei is a year and a half old. I met Fei Fei and her owner while going to Whole Foods yesterday.', 'uploads/1653237880.4684_C99B9268-6F3F-4BC2-9569-DB5A09EF3C1E.jpeg', '2022-05-22 11:45:30'),
